(1, 'Thank you for joining the [[site_name]] Community', 'Welcome block', 'home_top', 'home-top-block', NULL, NULL, 1, '<p>You can purchase Chronoly (CRNO) tokens by clicking through to the Buy Token page. If you have any questions regarding the project, get a quick response from our support by joining our telegram group here: <a href=\"https://t.me/Chronolyio\">https://t.me/Chronolyio</a></p>', NULL, 'active', 'en', 0, '2022-04-12 10:36:53', '2022-04-21 17:34:28'),
(2, 'How to buy?', 'How to buy?', 'how_buy', 'how-to-buy', NULL, NULL, 1, 'Login with your email and password then go to Buy Token!', NULL, 'hide', 'en', 0, '2022-04-12 10:36:53', '2022-04-21 13:49:22'),
(3, 'FAQ', 'FAQ', 'faq', 'faq', NULL, NULL, 1, 'Frequently Ask Questions...', NULL, 'hide', 'en', 0, '2022-04-12 10:36:53', '2022-04-21 14:22:35'),
(4, 'Privacy and Policy', 'Privacy Policy', 'privacy', 'privacy-policy', NULL, NULL, 1, '<h4 style=\"margin-top:20px;\"><strong>BEFORE USING OUR SITES, PLEASE READ THIS PRIVACY POLICY CAREFULLY.</strong></h4><p>This Privacy Policy is applicable to Chronoly(\"Company\") and sets out our policy on the gathering and use of information on this site and our other sites (collectively \"Sites\"). The Company is committed to providing safe web sites for visitors of all ages and has implemented this Privacy Policy to demonstrate our firm commitment to your privacy.&nbsp;</p><br><p>There may be links from our Sites to other websites; note that this Privacy Policy applies only to our Sites and not to web sites of other companies or organizations to which our Sites may be linked. You must check on any linked sites for the privacy policy that applies to that site and/or make any necessary inquiries in respect of that privacy policy with the operator of the linked site. These links to third party websites are provided as a convenience and are for informational purposes only. The Company does not endorse, and is not responsible for, these linked websites.</p><br><p>Although you are not required to register to access our Sites, you may be asked to provide us with personal information when you visit certain sections of our Sites. Your use of our Sites signifies your acknowledgement and consent to our Privacy Policy. If you do not agree to this Privacy Policy, please do not continue to use our Sites. Your continued use of the Sites signifies your acceptance of these terms and any changes in effect at the time of use.</p><h4><strong>COLLECTION OF PERSONAL INFORMATION</strong></h4><p>Personal Information is information about you that identifies you as an individual, for example, your name, address, e-mail address, or telephone number.</p><br><p>We collect information that you voluntarily provide to us through responses to surveys, search functions, questionnaires, feedback, Tell Your Story forms and the like. On some of our Sites, we offer health assessment tools that ask you to provide self-assessment information. We may also ask you to provide additional information such as your e-mail address if you want to obtain additional services, information, participate in a contest or to resolve complaints or concerns.</p><h4><strong>HOW DOES COMPANY USE INFORMATION GATHERED ABOUT ONLINE VISITORS?</strong></h4><p>Before forwarding us any personal information, please be advised that any information gathered on our Sites may be used in the aggregate for research and development relating to our Sites and/or for future site development and, if you ask us to, to send you promotional materials. In particular, we may use information gathered about you for the following purposes: to monitor interest in our range of products and to assist us to tailor the content of our Sites to your needs by collecting information about your preferences through tracking of patterns page views on our Sites; to create a profile relating to you in order to show you the content that might be of interest to you and to display the content according to your preferences; and, in circumstances where you have indicated that you wish to receive additional information, to send you information about us and promotional material about our products together with details of any offers we may have available from time to time.</p><h4 style=\"margin-top: 30px;\"><strong>CHRONOLY INFORMATIONAL OFFERS</strong><br></h4><p>With the permission of an online visitor, information submitted at the time of registration or submission may be used for marketing and promotional purposes by the Company provided notice of this fact is made available online. If a visitor objects to such use for any reason, he/she may prevent that use, either by email request or by modifying the registration information provided. The Company uses reasonable efforts to maintain visitors\' information in a secure environment. If you have submitted personal information and want to change it or opt-out, please contact us as described below.</p><h4><strong>DISCLOSURE OF INFORMATION</strong></h4><p>The Company will not disclose personal information that you provide on its Sites to any third parties other than to a Company agent except: i) in accordance with the terms of this Privacy Policy, or ii) to comply with legal requirements such as a law, regulation, warrant, subpoena or court order, and/or iii) if you are reporting an adverse event/side effect, in which case the Company may be required to disclose such information to bodies such as, but not limited to, international regulatory authorities.<br></p><h4><strong>COOKIES</strong><br></h4><p>The Company, in common with many web site operators, may use standard technology called \"cookies\" on its Sites. Cookies are small data files that are downloaded onto your computer when you visit a particular web site. You can disable cookies by turning them off in your browser; however, some areas of the Sites may not function properly if you do so.<strong><br></strong></p><h4><strong>PROTECTION OF CHILDREN ONLINE</strong></h4>\n<p>The Company considers the protection of children\'s privacy, especially online, to be of the utmost importance. We do not knowingly collect or solicit personal information from children nor do we allow them to become registered users of, or to request information through, our Sites or help-seeking information lines.</p>\n\n<h4><strong>ADDITIONAL TERMS FOR CERTAIN WEBSITES</strong></h4>\n<p>The following additional information applies to our Sites that require registration. Generally, you are not required to provide \n personal information as a condition of using our Sites, except as may be necessary to provide you with a product or service that you have requested. However, some of our Sites are restricted to certain individuals such as health care professionals or our prescription drug patients and we may require these individuals to register upon entry by providing us with certain information.</p><h4><strong>PROTECTION OF INFORMATION:</strong></h4>\n\n<p>We have put in place physical, electronic, and managerial procedures to safeguard and help prevent unauthorized access, maintain data security, and correctly use the information we collect online. The Company applies security safeguards appropriate to the sensitivity of the information, such as retaining information in secure facilities and making personal information accessible only to authorized employees on a need-to-know basis.</p>\n\n<p><strong>Storage of Information:</strong></p>\n\n<p>Personal information you share with us is stored on our database servers at Company data centers (in whatever country they may be located), or hosted by third parties who have entered into agreements with us that require them to observe our Privacy Policy.</p>\n\n<h4><strong>POLICY CHANGE:</strong></h4>\n\n<p>If we alter our Privacy Policy, any changes will be posted on this page of our Site so that you are always informed of the information we collect about you, how we use it and the circumstances under which we may disclose it.</p>\n\n<h4><strong>ACCEPTANCE OF OUR PRIVACY POLICY:</strong></h4>\n\n<p>By using this Site or any other The Company Site or interactive banner ads, you signify your acceptance of our Privacy Policy, and you adhere to the terms and conditions posted on the Site. By submitting your information, you agree that it will be governed by our Privacy Policy.</p>\n\n\n\n<p>Questions, concerns or complaints please contact us by sending an email to <a href=\"mailto:info@chronoly.io\">info@chronoly.io</a>\n</p>', NULL, 'active', 'en', 1, '2022-04-12 10:36:53', '2022-04-21 16:45:16'),
(5, 'Terms and Condition', 'Terms and Conditions', 'terms', 'terms-and-condition', NULL, NULL, 1, '<h4><strong>Terms Of Use</strong></h4><br><p>These Terms govern your access to, usage of all content, Product and Services available at website (the Service) operated by (us, we, or our). Your access to our services is subject to your acceptance, without modification, of all of the terms and conditions contained herein and all other operating rules and policies published and that may be published from time to time by us. Please read the Agreement carefully before accessing or using our Services. By accessing or using any part of our Services, you agree to be bound by these Terms. If you do not agree to any part of the terms of the Agreement, then you may not access or use our Services.&nbsp;</p><br><h4><strong>Copyright</strong></h4><br><p>We at CHRONOLY, reserve all copyrights on text or images on the platform. The text or images in the platform may not be copied or distributed without prior permission of Chronoly. If there is any approved use of content, the following conditions should be followed: The source of copied material should be mentioned as Chronoly, this statement should appear on all forms of distribution.&nbsp;</p><br><h4><strong>E-mail</strong></h4><br><p>You may choose to communicate with us via e-mail. However, in case you do so, you should note that the security of internet e-mail is unreliable. By sending confidential or sensitive e-mail messages which are unencrypted you accept the risks of such uncertainty and possible breach of confidentiality or privacy over the internet.&nbsp;</p><br><h4><strong>No Warranty</strong></h4><br><p>The information contained is provided by Chronoly&nbsp; as a service/promotion to its users, subscribers, customers and possible others. It does not contain (legal) advice. Although we try to provide quality information, we do not guarantee of results obtained from the use of this information, and without warranty of any kind, express or implied, including, but not limited to warranties of performance for a particular purpose.&nbsp;</p><br><h4><strong>No Liability</strong></h4><br><p>In no way is Chronoly is liable to user or any other party for any damages, costs of any character including but not limited to direct or indirect, consequential, incidental or other costs or damages, via the use of the information contained in the newsletters.&nbsp;</p><br><h4><strong>Changes</strong></h4><br><p>We may make changes to this information at any time without prior notice. We make no commitment to update the information contained in this newsletter.&nbsp;</p><br><h4><strong>Intellectual Property</strong></h4><br><p>The Agreement does not transfer from Us to you any of Ours or third-party intellectual property, and all right, title, and interest in and to such property will remain (as between the parties) solely with and its licensors.&nbsp;</p><br><h4><strong>Third Party Services</strong></h4><br><p>In using the Services, you may use third-party services, products, software, embeds, or applications developed by a third party (Third Party Services). If you use any Third-Party Services, you understand that: Any use of a Third-Party Service is at your own risk, and we shall not be responsible or liable to anyone for Third Party websites or Services. You acknowledge and agree that We shall not be responsible or liable for any damage or loss caused or alleged to be caused by or in connection with the use of any such content, goods or services available on or through any such web sites or services.&nbsp;</p><br><h4><strong>Accounts</strong></h4><br><p>Where use of any part of our Services requires an account, you agree to provide us with complete and accurate information when you register for an account. You will be solely responsible and liable for any activity that occurs under your account. You are responsible for keeping your account information up-to-date and for keeping your password secure. You are responsible for maintaining the security of your account that you use to access the Service. You shall not share or misuse your access credentials. You must notify us immediately of any unauthorized uses of your account or upon becoming aware of any other breach of security.&nbsp;</p><br><h4><strong>Termination</strong></h4><br><p>We may terminate or suspend your access to all or any part of our Services at any time, with or without cause, with or without notice, effective immediately. If you wish to terminate the Agreement or your account, you may simply discontinue using our Services. All provisions of the Agreement which by their nature should survive termination shall survive termination, including, without limitation, ownership provisions, warranty disclaimers, indemnity, and limitations of liability.&nbsp;</p><br><h4><strong>Disclaimer</strong></h4><br><p>Our Services are provided AS IS. and AS AVAILABLE basis. and its suppliers and licensors hereby disclaim all warranties of any kind, express or implied, including, without limitation, the warranties of merchantability, fitness for a particular purpose and non-infringement.&nbsp;</p><br><p>Neither, nor its suppliers and licensors, makes any warranty that our Services will be error free or that access thereto will be continuous or uninterrupted. You understand that you download from, or otherwise obtain content or services through, our Services at your own discretion and risk.&nbsp;</p><br><h4><strong>Jurisdiction and Applicable Law</strong></h4><br><p>Except to the extent any applicable law provides otherwise, the Agreement and any access to or use of our Services will be governed by the laws of the British Virgin Islands (BVI). The proper venue for any disputes arising out of or relating to the Agreement and any access to or use of our Services will be in the courts located in the BVI.</p><br><h4><strong>Changes</strong></h4><br><p>Chronoly reserves the right, at our sole discretion, to modify or replace these Terms at any time. If we make changes that are material, we will let you know by posting on our website, or by sending you an email or other communication before the changes take effect. The notice will designate a reasonable period of time after which the new terms will take effect. If you disagree with our changes, then you should stop using our Services within the designated notice period, or once the changes become effective. Your continued use of our Services will be subject to the new terms.&nbsp;</p>&nbsp;<br>&nbsp;&nbsp;<p><br></p>', NULL, 'active', 'en', 1, '2022-04-12 10:36:53', '2022-04-21 16:45:50'),
